There are many factors I credit for our success at the Olympics, and one was our intention to enjoy the experience and celebrate all of it, regardless of the outcome.

So I have to thank @reserveps for helping us kick off our trip to Tokyo in the best way possible! Peace and quiet🧘🏼‍♀️, a charcuterie board🧀, champagne🥂, massages💆🏼‍♀️ (literally everything we could have asked for 🥰) plus private TSA security and a sweet ride to our gate 🙌🏼 Thank you #PrivateSuite for making our embarkation not only stress free, but extremely enjoyable and setting the tone for our Olympic experience!🥇❤️ 

